import React from 'react';
import axios from 'axios';

export default class SpaceXList extends React.Component{

  state = {
    SpaceX:[],
    viewCall : false,
  };


  componentDidMount() {
    axios.get("https://api.spacexdata.com/v3/launches")
    .then(res => {
      this.setState({ viewCall : false, SpaceX : res.data});
    })
  }

  render() {
    return (
      <ul>
      <table align="center">
      <th> Flight Number </th>
      <th> Year </th>
        {this.state.SpaceX.map(SpaceX => <tr> <td> { SpaceX.flight_number } </td>
                                         <td> {SpaceX.launch_year} </td> </tr> )}
      </table>
      </ul>
    )

  }

}
